void MainComponent::GetFiltersTransmittance(double frequency, double& sample)
{
	sample = iir_low_shelf_filter_->Spectrum(frequency);
	sample *= iir_high_shelf_filter_->Spectrum(frequency);
	sample *= iir_parametric_band_pass_filter_1_->Spectrum(frequency);
	sample *= iir_parametric_band_pass_filter_2_->Spectrum(frequency);

}

void MainComponent::SetScreenComponentFiltersSpectrum()
{
	screen_component_->ClearFilterSpectrum();
	double sample;;
	for (auto i = 0; i<screen_component_->getWidth(); ++i)
	{
		double frequency = screen_component_->GetFilterSpectrumXAxis(i);
		GetFiltersTransmittance(frequency, sample);
		screen_component_->SetFilterSpectrum(sample);
	}
}

